import React from 'react';
import { View, StyleSheet } from 'react-native';
import Banner from './Banner';

const Home = () => {
    return (
        <View>
            <Banner />
        </View>
    );
}

const styles = StyleSheet.create({
    homeContainer:{
        width:'100vw',
        
    }
})

export default Home;
